            var html_fb3a558bd5ea4256b85b582571575ff6 = $(`<div id="html_fb3a558bd5ea4256b85b582571575ff6" style="width: 100.0%; height: 100.0%;">Stage 3: Devils in the morning, hell in the evening <br>                     93.8km,                      1354m ascent <br>                     Started with Seven Devils road. Quiet, and beautiful, but tough going. Footlong subs all round in Bandon for lunch, and then into the most demoralising piece of riding imaginable: 50 straight km into a block headwind gusting 50mph. We were naive in stopping for a breather in Port Orford; the storm front swept in and the last 10km was in driving hail. By the time we made camp at Mt Humbug everything was sodden. <br>                     <a href="https://www.strava.com/activities/2410283760">Strava link</a> </div>`)[0];

            var html_59ec2bc22cf240628923d205ca823706 = $(`<div id="html_59ec2bc22cf240628923d205ca823706" style="width: 100.0%; height: 100.0%;">Stage 4: Into California <br>                     127.0km,                      1264m ascent <br>                     The day started calm and overcast. The riding down the coast was spectacular, Arizona beach in particular. We made the border with California in mid-afternoon and decided to push for another 25km to a campsite in the Redwoods. Unfortunately as soon as were over Armen ran over deliberately placed tacks, puncturing twice, so we were caught out in yet another storm. The silver lining was that we arrived at the camp in such a state that Christian and Rain, the rangers, took pity on us and sorted us out with unlimited showers, beer and a fire. <br>                     <a href="https://www.strava.com/activities/2410283792">Strava link</a> </div>`)[0];

            var html_268099b877ac4612b6c4f52c4da84b04 = $(`<div id="html_268099b877ac4612b6c4f52c4da84b04" style="width: 100.0%; height: 100.0%;">Stage 6: Motorway miles <br>                     170.7km,                      1325m ascent <br>                     The wind was finally in our favour so we pushed hard to make up lost ground from the earlier days (due to the terrible weather). This was the perfect day to do it: a good 100km on dual-carriageway sections of the 101, so there wasn't exactly much in the way of scenery to miss out on. The final 50km was along Avenue of the Giants was perfection as we had the whole thing to ourselves. The campsite turned out to be closed so we found a convenient bush opposite a fabulous hotel to pitch up our tent and then blagged our way in for a hot shower (and complimentary sherry!?) <br>                     <a href="https://www.strava.com/activities/2410283961">Strava link</a> </div>`)[0];

            var html_5436e989986f466d8b910c48750de1ad = $(`<div id="html_5436e989986f466d8b910c48750de1ad" style="width: 100.0%; height: 100.0%;">Stage 7: Micro-climates <br>                     120.2km,                      1749m ascent <br>                     Started HOT. Left the 101 at Legett to join the 1 and head back out to the cost via 2 tasty hills. As soon as we crested the first one we entered a completely different (and now-familiar) weather system: cold, dark and wet. Once back on the coast, Westport delighted us with the worlds most expensive sandwich, as did Fort Bragg with the world's best calorie/$ ratio: $8 for the 2000-cal all-American Super Sub (one was enough for both of us!) Camp was at Russian Gulch, the first time in California we actually paid for a site, and luckily so as the rangers were round to check first thing next morning. <br>                     <a href="https://www.strava.com/activities/2410284106">Strava link</a> </div>`)[0];

// async function to fetch an image from a remote URL 
// and encode it as b64 string for insertion into the 
// iframe of a popup. 
// NB returns the image in the form "data:image/jpeg;base64,IMAGE_64"

if (window.screen.width < 500) {
    window.alert('This map works best on large screens.')
}

async function getBase64FromUrl(url) {
    const data = await fetch(url);
    const blob = await data.blob();
    return new Promise((resolve) => {
        const reader = new FileReader();
        reader.readAsDataURL(blob); 
        reader.onloadend = () => {
            const base64data = reader.result;   
            resolve(base64data);
        }
    });
}

// function TEMPLATE to dynamically fetch and insert a remote image 
// from URL into a leaflet popup. This file should be templated using 
// python's string.Template().substitute() functionality, which will 
// replace the $idx and $img parameters with the appropriate
// index number and image name (eg, 12, ABC.jpeg). One of these must be 
// created per popup on the map, hence the need for templating. 

marker_image_0.on('click', function() {
    var url = "https://tomfrankkirk.github.io/assets/images/pacific/IMG_4758.jpeg"
    var pop = marker_image_0.getPopup(); 
    getBase64FromUrl(url).then(
        function(img) {
            var style = popup_image_0.getContent().firstElementChild.style;
            var imgh = parseInt(style.height.slice(0,3)); 
            var imgw = parseInt(style.width.slice(0,3)); 

            var margh = window.innerHeight - imgh; 
            var margw = window.innerWidth - imgw; 

            if (margh < margw) { 
                console.log('constrained y')
                h = Math.min(window.innerHeight - 150, 500)
                w = (h / imgh) * imgw; 
            } else { 
                console.log('constrained x')
                w = Math.min(window.innerWidth - 100, 700)
                h = (w / imgw) * imgh; 
            }
            style.width = w + "px";
            style.height = h + "px"; 
            pop.options.maxWidth = "auto";
            pop.options.maxHeight = "auto";
            pop.setContent($(`<div id="" style='${style.cssText}'><img src='${img}' alt='Could not load' style='${style.cssText}'/></div>`)[0]) 
            var px = map_basemap.project(pop.getLatLng());
            px.y -= 0.7 * h; 
            map_basemap.panTo(map_basemap.unproject(px), {animate: true});

        },
        function(error) { console.log('Could not load b64 remote image'); }
    )

});

// replace the $idx and $img parameters with the appropriate
// index number and image name (eg, 12, ABC.jpeg). One of these must be 
// created per popup on the map, hence the need for templating. 

marker_image_75.on('click', function() {
    var url = "https://tomfrankkirk.github.io/assets/images/pacific/IMG_4833.jpeg"
    var pop = marker_image_75.getPopup(); 
    getBase64FromUrl(url).then(
        function(img) {
            var style = popup_image_75.getContent().firstElementChild.style;
            var imgh = parseInt(style.height.slice(0,3)); 
            var imgw = parseInt(style.width.slice(0,3)); 

            var margh = window.innerHeight - imgh; 
            var margw = window.innerWidth - imgw; 

            if (margh < margw) { 
                console.log('constrained y')
                h = Math.min(window.innerHeight - 150, 500)
                w = (h / imgh) * imgw; 
            } else { 
                console.log('constrained x')
                w = Math.min(window.innerWidth - 100, 700)
                h = (w / imgw) * imgh; 
            }
            style.width = w + "px";
            style.height = h + "px"; 
            pop.options.maxWidth = "auto";
            pop.options.maxHeight = "auto";
            pop.setContent($(`<div id="" style='${style.cssText}'><img src='${img}' alt='Could not load' style='${style.cssText}'/></div>`)[0]) 
            var px = map_basemap.project(pop.getLatLng());
            px.y -= 0.7 * h; 
            map_basemap.panTo(map_basemap.unproject(px), {animate: true});

        },
        function(error) { console.log('Could not load b64 remote image'); }
    )

});
